In Bnei Zion, a little outside Tel Aviv nestled in cozy hills near a nature preserve, surrounded by luxe homes and the sound of singing school kids from the nearby school, sits a paradise filled with the most amazingly colorful treasures.

@farma_cultura is one of those places that exists in a dream - a picture perfect kitchen with immaculately curated antiques, their natural scaped gardens, bursting with berries, papaya, senna, lavender, hyssop, tons of vegetables and a rainbow of wildflowers.

It was such a treat to explore the small farm, see the family's passion for farming, and love of entertaining. The food was as delicious as it was colorful - with love bursting out of every bite.

This is one treasure in Israel that absolutely can't be missed.

