Nazareth, you're a beaut ❤️

The home of the Basilica of Annunciation, the Synagogue Church Jesus prayed in, St Joseph's Church - also has amazing food. As the Arabic capital of Israel, Nazareth has a taste all its own - you'll find Lebanese, Iraqi, Syrian, Iranian, Yemeni, and Palestinian foods all over the city's winding walkways and picture perfect hillside. Be sure to book a tour with @my.souk - the unofficial Mayor of Joy for Nazareth (as I called him) and then finish the day with dinner at @luna.bistro where Luna's love-filled dishes will blow your mind!

@vibeisrael #vibetastes #israel #nazareth

Did you know #Israel is a food tech and innovation hub? We got to taste @chunk_foods ' plant-based steaks and cook a bit with them - I'm a meat lover, but they are perfect as a swap for Lent for me! (Plus no weird ingredients - the flavor and texture is all from fermented veggies - not a laundry list of junk nobody wants to eat!)

Would you eat a meat alternative? Do you like meat swaps occasionally? We're #orthodoxchristian and go fully vegan for Lent (as well as other fasting periods) and substitutes like these make life a bit easier when shifting meat lovers to #vegan ! 

