Ride the tram down from Masada with me 🇮🇱 

High above the Dead Sea in the Negev Desert in Southern Israel is a UNESCO heritage site like no other... people actually get there early in the morning to hike the snake trail to watch the sun rise over the dead sea... can you imagine how gorgeous this view would be? 

Have you ever been to @masada_national_park ? My tour guide Yossi, who I booked through @touristisrael , helped make my trek from Tel Aviv easy and comfortable - and was the BEST guide around for a day through the Southern District, and on to the Jordan River baptism site and then on to Jericho. I'll be sharing more from this epic day (I stayed for an extra day of touring after a week eating my way through Israel with @vibeisrael - check out  #vibetastes for more of our week!)

If you're considering a trip to Israel, #Masada is a must!

